// Import Assets
import coffeeToken from '../assets/CoffeeToken.png';
import duckToken from '../assets/Duck.png';

const Projects = () => {
    return (
        <section className="projects">
            <h2>My Projects</h2>

            <div className="projects__cards">

                <div className="projects__card">
                    <h3>Shop</h3>
                    <img src={coffeeToken} alt="CoffeeToken" />
                    <p>A project  where a seller can sign up and add his product to the shop
                    </p>

                    <a href="https://github.com/maxinejng/shop" target="_blank" className="button">Github code</a>
                </div>

                <div className="projects__card">
                    <h3>Duck ERC 721</h3>
                    <img src={duckToken} alt="Duck Token" />
                    <p> An ERC 721 token created with Open Zeppelin and deployed on OpenSea
                    </p>

                    <a href="https://testnets.opensea.io/fr/assets/goerli/0xc3e3a80997c2b01d6627d50a677f1c4a337b04f7/0" target="_blank" className="button">Site</a>
                    <a href="https://github.com/maxinejng/duck-ERC721" target="_blank" className="button">Code</a>
                </div>
            </div>
        </section>
    );
}

export default Projects;
